import React from "react";
import ReactDOM from "react-dom";

function TodoItem(props) {
  const styles = {
    color: "purple",
    fontSize: 16,
    marginLeft: 10,
  };
  return (
    <div>
      <input type="checkbox" checked={props.todos.completed} />
      <label style={styles}>{props.todos.text}</label>
    </div>
  );
}

export default TodoItem;
